original_question:
En rektangulär fält är innesluten i en idrottsbana, som visas nedan. Banan består av två kanter av fältet och två halvcirklar. Banans längd är 400 meter. Vad är den största möjliga arean av fältet, i kvadratmeter?

[asy]
unitsize(1 cm);

filldraw((0,0)--(3,0)--(3,2)--(0,2)--cycle,lightgreen);
draw((0,0)--(3,0),linewidth(2*bp));
draw((0,2)--(3,2),linewidth(2*bp));
draw(arc((3,1),1,-90,90),linewidth(2*bp));
draw(arc((0,1),1,90,270),linewidth(2*bp));
[/asy]

