original_question:
Rektangel $ABCD$ har centrum $O$ och $AB/AD=k$. En punkt väljs slumpmässigt från insidan av rektangeln $ABCD$. Vad är sannolikheten att den är närmare $O$ än någon av de fyra hörnen?  [asy]
size(200);
draw((-250,100)--(250,100)--(250,-100)--(-250,-100)--cycle);
dot((0,0));
label("$O$",(0,0),N);
label("$A$",(-250,100),NW); label("$B$",(250,100),NE); label("$C$",(250,-100),SE); label("$D$",(-250,-100),SW);[/asy]

